import React, { Component } from "react";

class F extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="lm">
        <div>
          <div className="org-fr org-fjc-sb lf bg-blue">
            <div> My Password is not working , what to do ?</div>
            <div>
              <i className="fa fa-plus sp"></i>
            </div>
          </div>
          <div>Send email on Contact Us section on Website</div>
        </div>
      </div>
    );
  }
}

export default F;
